import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";

export default function Home(){
    return(
      <div>
        <Navbar/>
        <div className="max-w-sm p-12 bg-white border border-gray-200 rounded-lg shadow dark:bg-gray-800 dark:border-gray-700">
  <a href="#">
    <h5 className="mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white">February Events 2023</h5>
  </a>
  <p className="mb-3 font-normal text-gray-700 dark:text-gray-400">
    Here are the biggest enterprise technology acquisitions of 2021 so far, inreverse chronological order.
  </p>
</div>
        <Footer/>
      </div>  
    )
}
